import React from 'react'


const Card = ( {movie} ) => {
  return ( 
    <div className='card'>
        <img src={movie.poster_path ? 
            "https://image.tmdb.org/t/p/w500" + movie.poster_path : "."}
        />
        {movie.title}
    </div>
  )
}



export default Card;
